import React from 'react';
import Header from '../components/Header';
import CompanyDetails from '../components/CompanyDetails';
import ContractList from '../components/ContractList';

const HomePage = () => {
  return (
    <div>
      <Header />
      <CompanyDetails />
      <ContractList />
    </div>
  );
};

export default HomePage;
